import React, { Component, Fragment } from 'react';
import { Menu, Icon } from 'antd';
import logo from './logo.png';
import './style.css';

class Header extends Component{

constructor(props){
    super(props)
   this.state={
    
   list:[

     {

       icon:'a',
       key:'mail',
       value:'hello world'
     },
     {

      icon:'mail',
      key:'c',
      value:'hello world'
    },
    {

      icon:'mail',
      key:'b',
      value:'hello world'
    },
    {

     icon:'mail',
     key:'a',
     value:'hello world'
   },

   ]
   }}





render(){
    return (
      <Fragment>
      <img src={logo} alt="logo" className="logo" />
      <Menu mode="horizontal">
      <Menu.Item key="mail">
          <Icon type="mail" />
          Navigation One
        </Menu.Item>
    </Menu>
    </Fragment>
 )
}
}


export default Header;
